script: |
  super -f text -I q10352.spq | sort > q10352.out

inputs:
  - name: q10352.spq
    data: |
      SELECT ALL 72 FROM tab0 (FORMAT parquet) cor0 WHERE col0 / col0 NOT BETWEEN col2 * + col0 * 81 AND + col2 * + 45 - 17;
  - name: tab0

outputs:
  - name: q10352.out
    data: |
      72
      72
      72
